import axios from 'axios';

const appId = '11D0FD4D-C1F1-39E3-FF8A-2861151B0D00';
const Apikey = '82E69DA6-1A6F-473B-A7E9-9F1E3CF97ECB';

export default axios.create({
    baseURL: `https://api.backendless.com/${appId}/${Apikey}/`,

});
